package mypractice.basicexamples.operators;

public class CompoundAssignment {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int count = 1;

	    count += 5;
	    System.out.println(count);

	    count = count + 5;
	    System.out.println(count);

	}

}
